import React from 'react';

import classes from './Movie.module.css';

const Movie = (props) => {
  return (
    <li className={classes.movie}>
      <h2>{props.Name}</h2>
      <h3>{props.Model}</h3>
      {/* <p>{props.Manufacturer}</p> */}
    </li>
  );
};

export default Movie;
